-- ----------------------------
-- View structure for reporte
-- ----------------------------
DROP VIEW IF EXISTS "public"."reporte";
CREATE VIEW "public"."reporte" AS  SELECT date_part('year'::text, ch.created_at) AS anio,
    date_part('month'::text, ch.created_at) AS mes,
    date_part('day'::text, ch.created_at) AS dia,
    co.company_name AS compania,
    ch.status AS estatus,
    sum(ch.amount) AS monto
   FROM (companies co
     JOIN charges ch ON (((co.id)::text = (ch.company_id)::text)))
  GROUP BY (date_part('year'::text, ch.created_at)), (date_part('month'::text, ch.created_at)), (date_part('day'::text, ch.created_at)), co.company_name, ch.status
  ORDER BY co.company_name, (date_part('year'::text, ch.created_at)), (date_part('month'::text, ch.created_at)), (date_part('day'::text, ch.created_at)), ch.status;

